import './App.css';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <>
        <Route path='' element={<Login />}/>
        <Route path='/home' element={<Home />} />
      </>
    </Routes>
  </BrowserRouter>
  );
}

export default App;
